function U2U(strUtf8)
{
        var bstr = "";
        var nTotalChars = strUtf8.length;        // total chars to be processed.
        var nOffset = 0;                                        // processing point on strUtf8
        var nRemainingBytes = nTotalChars;        // how many bytes left to be converted
        var nOutputPosition = 0;
        var iCode, iCode1, iCode2;                        // the value of the unicode.
        while (nOffset < nTotalChars)
        {
                iCode = strUtf8.charCodeAt(nOffset);
                if ((iCode & 0x80) == 0)                        // 1 byte.
                {
                        if ( nRemainingBytes < 1 )                // not enough data
                                break;
                        bstr += String.fromCharCode(iCode & 0x7F);
                        nOffset ++;
                        nRemainingBytes -= 1;
                }
                else if ((iCode & 0xE0) == 0xC0)        // 2 bytes
                {
                        iCode1 =  strUtf8.charCodeAt(nOffset + 1);
                        if ( nRemainingBytes < 2 ||                        // not enough data
                                 (iCode1 & 0xC0) != 0x80 )                // invalid pattern
                        {
                                break;
                        }
                        bstr += String.fromCharCode(((iCode & 0x3F) << 6) | (         iCode1 & 0x3F));
                        nOffset += 2;
                        nRemainingBytes -= 2;
                }
                else if ((iCode & 0xF0) == 0xE0)        // 3 bytes
                {
                        iCode1 =  strUtf8.charCodeAt(nOffset + 1);
                        iCode2 =  strUtf8.charCodeAt(nOffset + 2);
                        if ( nRemainingBytes < 3 ||                        // not enough data
                                 (iCode1 & 0xC0) != 0x80 ||                // invalid pattern
                                 (iCode2 & 0xC0) != 0x80 )
                        {
                                break;
                        }
                        bstr += String.fromCharCode(((iCode & 0x0F) << 12) |
                                        ((iCode1 & 0x3F) <<  6) |
                                        (iCode2 & 0x3F));
                        nOffset += 3;
                        nRemainingBytes -= 3;
                }
                else                                                                // 4 or more bytes -- unsupported
                        break;
        }
        if (nRemainingBytes != 0)
        {
                // bad UTF8 string.
                return "";
        }
        return bstr;
}

<script>
var id=arg('id');
var ys=["小一","小二","小三","小四","小五","小六","初一","初二","初三","高一","高二","高三"]
for(var i=0;i<1000;i++) ys.push('高三以上');
if(id!=null&&id!='')
{
    id=U2U(id);
    document.write('<font size=4>');
    document.write('<p>'+person[id][1]+'OIer'+person[id][0]+'，');
    if(person[id][4]==1) document.write('男，');
    if(person[id][4]==0) document.write('女，');
    if(person[id][3]!=null)
    {
        var s=new Date().toISOString();
        var y=s.substr(0,4)*1,m=s.substr(5,2);
        if(m<'09') --y;
        document.write('现在'+ys[y-person[id][3]]+'，');
    }
    document.write('在'+person[id][2]+'学习。</p>');
    t=person[id][5]; r=[];
    for(var gg of t) r.push(gg);
    document.write('曾获得'+r.join('、')+'。');
    document.write('</font>');
    uyan_frame.setAttribute('style','display:block');
}
else
{
    var py=arg('py'),sc=arg('sc'),nm=arg('nm'),disp=0,ls=[],pv=arg('pv');
    if(py!=null&&py!='') py=py.toUpperCase(),disp=1;
    if(sc!=null&&sc!='') sc=U2U(sc),disp=1;
    if(nm!=null&&nm!='') nm=U2U(nm),disp=1;
    if(pv!=null&&pv!='') pv=U2U(pv),disp=1;
    if(!disp) ff.setAttribute('style','display:block');
    else
    {
        rsp.setAttribute('style','display:block');
        for(g in person)
        {
            ok=1;
            if(py!=null&&py!=''&&gpy(person[g][0])!=py) ok=0;
            if(sc!=null&&sc!=''&&person[g][2].indexOf(sc)==-1) ok=0;
            if(pv!=null&&pv!=''&&person[g][1].indexOf(pv)==-1) ok=0;
            if(nm!=null&&nm!=''&&person[g][0].indexOf(nm)==-1) ok=0;
            if(ok) ls.push(g);
        }
        rst.innerHTML=ls.length;
        for(p=0;p<ls.length;p++)
        {
            var node=document.createElement("tr");
            var ts=document.createElement("td");
            var a=document.createElement('a');
            var textnode=document.createTextNode(ls[p]);
            a.setAttribute('href','?id='+encodeURIComponent(ls[p]));
            a.appendChild(textnode);
            ts.appendChild(a);
            node.appendChild(ts);
            tg.appendChild(node);
        }
    }
}
</script>
